import React, {Component} from 'react';
import { View } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';

// Screens
import {StackCategoriasScreen} from "../Screens/StackCategoriasScreen";
import {DetailsCategoriaScreen} from "../Screens/DetailsCategoriaScreen";

const Stack = createStackNavigator();

export class StackMenu extends Component {
  
  render(){
    return (
      <View>
          <Text>Stack Menu</Text>
          <Stack.Navigator initialRouteName="Home">
            <Stack.Screen name="Categorias" component={StackCategoriasScreen} options={{title:"REGISTRE SUS COMPRAS"}}/>
            <Stack.Screen name="Details" component={DetailsCategoriaScreen} options={{title:"Detalles"}}/>
          </Stack.Navigator>
        </View>
    );
  }
}
